webpackJsonp([0xfa2b30d48cc2],{493:function(e,t){e.exports={data:{allMarkdownRemark:{edges:[{node:{html:"<p>We have used Sue Dann Interiors twice now to advise us on the new design and refurbishment of our homes, and cannot recommend her highly enough. Her attention to detail, whether of design or on the financial side, was thorough and professional. She spent a lot of time familiarising herself with our own tastes and ideas, then provided us with a huge range of choice and alternatives, which resulted in beautiful and functional interiors.</p>",frontmatter:{name:"Mr & Mrs Woods",address:"Wellow, Somerset",caseStudyTitle:"Case Study: Peroid Cottage near Bath",caseStudyLink:"/domestic/2011-period-cottage",caseStudyCover:"2011-period-cottage/dom2o.jpg"}}},{node:{html:"<p>We are absolutely thrilled with the renovation project Sue Dann has carried out for us. The apartment is totally transformed by Sue’s stylish creativity, sourcing of wonderful interiors and excellent project management.</p>\n<p>Sue has been very professional with all the people she has come into contact with, such as clients, suppliers, construction workers, and indeed other apartment owners. Sue has kept us very well informed with progress of the works, costs and made it a trouble-free experience for us.</p>\n<p>We could not have achieved this result without Sue Dann and we are delighted with the stunning home we can now enjoy.</p>",frontmatter:{name:"Mr & Mrs Eve",address:"Sydney Place, Bath",caseStudyTitle:"Case Study: Georgian Apartment in Sydney Place, Bath",caseStudyLink:"/domestic/2008-georgian-apartment",caseStudyCover:"2008-georgian-apartment/dom4j.jpg"}}},{node:{html:"<p>Dear Sue, just a little note to say a big thank you for all the hard work you put in re-vamping our house. We are really delighted with the final result.</p>\n<p>All the colours, soft furnishings and accessories work beautifully. The finished project has exceeded our expectations and our son’s girlfriend commented that our home should be in one of the Home Design Magazines!</p>",frontmatter:{name:"Janet Singleton and Richard Moffatt",address:"Rode, Somerset",caseStudyTitle:"Case Study: Victorian Country House in Rode, Somerset",caseStudyLink:"/domestic/2012-victorian-country-house",caseStudyCover:"2012-victorian-country-house/dom1r.jpg"}}},{node:{html:"<p>Sue Dann has worked with us on several projects, which involved designing fairly complex public areas in our Hotels. We have found her to be very enthusiastic, and her work has been inspiring. We have also found her to be able to work within budgetary confines, a rare ability in the designer world! Her touch of style and class is very evident in her schemes.</p>\n<p>Sue always has a professional and commercial approach to any project, and her ability to source specific items is a great asset. She has a wealth of knowledge, and her design experience is very apparent. She takes real personal interest in her projects, and we heartily recommend her to any potential client.</p>",frontmatter:{name:"Nick Sonley, Operations & Development Director, Zola Hotels",address:"Central Office, 30 High Street, Old Amersham, Bucks, HP7 0DJ",caseStudyTitle:"The Kings Arms Hotel, Old Amersham on our Commercial Design page",caseStudyLink:"/commercial",caseStudyCover:"commercial/com13.jpg"}}}]}},pathContext:{}}}});
